import { useNavigate } from "react-router-dom";

const SearchResultsRow = ({ key, house }: { key: any; house: any }) => {
  const history = useNavigate();
  const setActive = () => {
    history(`/House/${house.id}`);
  };
  return (
    <tr onClick={setActive}>
      <td>{house.address}</td>
      <td>{house.photo}</td>
      <td>{house.likes}</td>
    </tr>
  );
};

export default SearchResultsRow;
